import React from 'react';
import ScriptTag from 'react-script-tag';
import Navbar from './_share/Navbar.js';
import Main_content from './_share/Main_content.js';
import Footer from './_share/Footer.js';
// scss 
import '../../template/template_customer_customer/fonts/icomoon/style.css'
import '../../template/template_customer_customer/css/bootstrap.min.css'
import '../../template/template_customer_customer/css/magnific-popup.css'
import '../../template/template_customer_customer/css/jquery-ui.css'
import '../../template/template_customer_customer/css/owl.carousel.min.css'
import '../../template/template_customer_customer/css/owl.theme.default.min.css'
import '../../template/template_customer_customer/css/aos.css'
import '../../template/template_customer_customer/css/style.css'

const Customer_layout = ({ section }) => {
	return (
		<div className="site-wrap">
				<Navbar />
				<Main_content section={section} />
				<Footer />
				<ScriptTag src="/template/template_customer_customer/js/jquery-3.3.1.min.js"></ScriptTag>
			    <ScriptTag src="/template/template_customer_customer/js/jquery-ui.js"></ScriptTag>
			    <ScriptTag src="/template/template_customer_customer/js/popper.min.js"></ScriptTag>
			    <ScriptTag src="/template/template_customer_customer/js/bootstrap.min.js"></ScriptTag>
			    <ScriptTag src="/template/template_customer_customer/js/owl.carousel.min.js"></ScriptTag>
			    <ScriptTag src="/template/template_customer_customer/js/jquery.magnific-popup.min.js"></ScriptTag>
			    <ScriptTag src="/template/template_customer_customer/js/aos.js"></ScriptTag>
			    <ScriptTag src="/template/template_customer_customer/js/main.js"></ScriptTag>
		</div>
	)
}

export default Customer_layout
